import React from "react";
import "./App.css";
import TopNav from "./TopNav";
import AllCategories from "./AllCategories";
import OrderButton from "./OrderButton";

function App() {
	let orderButton = (
		<ul className="collapsible">
			<OrderButton />
		</ul>
	);

	function parseFinalOrder(finalOrderMap) {
		finalOrderMap.forEach(item => {
			console.log(item);
		});
	}

	return (
		<div className="App">
			<TopNav />
			<AllCategories
				orderButton={orderButton}
				parseFinalOrder={parseFinalOrder}
			/>
		</div>
	);
}

export default App;
